import "./App.css";
import Header from "./components/Header.js"
import SearchBar from "./components/SearchBar.js";
import Table from "./components/Table.js"
import Footer from "./components/Footer.js"
import headerImg from "./components/images/extch.png";

function App() {
  return (
    <>
      {/* Header */}

      <div>
      <center>
        <img class="img" src={headerImg} alt="ExTech Job Search Logo" width={300}></img>
      </center>
      <div class="header">
        <center>
          <h1>Exemplify tech. Job searching. Simplified.</h1>
        </center>
        <center>
          <h3>
            With the company roles, dates, and apply links, we strive to
            simplify
            <br></br> the job searching & filtering process, catered towards
            your needs.
          </h3>
          <p>The best tech job searching platform on the internet.</p>
        </center>
      </div>
    </div>
      {/* Search Bar */}
      <SearchBar />

      {/* Table */}/
      <Table />

      {/* Footer */}
      <Footer />
    </>
  );
}

export default App;
